import { PetsCard } from './components/PetsCards/PetsCards';
import categories from './components/Data/PetsCategories'
import catIcon from "./images/cat20-128.webp"
import ReactDOM from "react-dom";
import {
   Router,
  Switch,
  Route
} from "react-router-dom";

import { createBrowserHistory } from 'history';

export const history= createBrowserHistory();

function App() {

  return (

      <Router history={history}>
        <Switch> 
            <Route exact path="/categories"><span>Header</span></Route>
            <Route exact path="/" ><span onClick={()=>(history.push('/categories'))}>Here</span></Route>
          </Switch>
      </Router>
  );
}

